    "  ---\n",
    "\n",
    "  Cluster 0: Publicaciones de Bajo Compromiso\n",
    "\n",
    "   * Características Principales:\n",
    "       * Interacción Baja: Este grupo tiene el promedio más bajo en todas\n",
    "         las métricas: reacciones, comentarios, y compartidos.\n",
    "       * Tipo de Contenido: Principalmente compuesto por fotos (photo),\n",
    "         seguido de videos y actualizaciones de estado (status).\n",
    "   * Interpretación:\n",
    "       * Este cluster representa el contenido \"común\" o de bajo impacto en\n",
    "          la plataforma. Son publicaciones que no logran captar una gran\n",
    "         atención de la audiencia y, por lo tanto, generan muy poca\n",
    "         interacción.\n",
    "\n",
    "  ---\n",
    "\n",
    "  Cluster 1: Videos Populares con Reacciones Positivas\n",
    "\n",
    "   * Características Principales:\n",
    "       * Altas Reacciones, Baja Discusión: Se caracteriza por tener un\n",
    "         número muy alto de num_reactions y num_likes, pero\n",
    "         sorprendentemente pocos comentarios y compartidos.\n",
    "       * Tipo de Contenido: Dominado por videos (video).\n",
    "   * Interpretación:\n",
    "       * Este cluster agrupa contenido que es muy popular y del agrado de\n",
    "         la gente (gusta mucho), pero que no necesariamente fomenta la\n",
    "         conversación. Podrían ser videos entretenidos, musicales o\n",
    "         visualmente atractivos que la gente disfruta y reacciona, pero no\n",
    "          siente la necesidad de comentar o compartir masivamente.\n",
    "\n",
    "  ---\n",
    "\n",
    "  Cluster 2: Videos que Generan Debate y Controversia\n",
    "\n",
    "   * Características Principales:\n",
    "       * Discusión Intensa: El rasgo más distintivo es el número\n",
    "         extremadamente alto de num_comments, muy por encima de los otros\n",
    "         clusters. También tiene un número elevado de num_shares.\n",
    "       * Reacciones Mixtas: Aunque tiene un buen número de reacciones,\n",
    "         también es el cluster con más num_sads y num_angrys, lo que\n",
    "         indica que el contenido puede ser polarizante.\n",
    "       * Tipo de Contenido: Casi exclusivamente videos (video).\n",
    "   * Interpretación:\n",
    "       * Este cluster representa contenido que genera mucha discusión y\n",
    "         debate. Los videos en este grupo probablemente tratan temas\n",
    "         controversiales, emocionales o de opinión que incitan a los\n",
    "         usuarios a dejar comentarios y compartir su punto de vista.\n",
    "\n",
    "  ---\n",
    "\n",
    "  Cluster 3: Contenido Viral y Altamente Emocional\n",
    "\n",
    "   * Características Principales:\n",
    "       * Interacción Masiva y Diversa: Este cluster tiene promedios muy\n",
    "         altos en todas las métricas de interacción.\n",
    "       * Explosión de Reacciones \"Wow\": Es, con diferencia, el cluster con\n",
    "          el mayor número de num_wows y num_loves, indicando que el\n",
    "         contenido es percibido como sorprendente y muy querido.\n",
    "       * Alto Alcance: El alto número de num_shares confirma su naturaleza\n",
    "          viral.\n",
    "   * Interpretación:\n",
    "       * Este es el cluster del \"contenido viral\". Representa\n",
    "         publicaciones que explotan en popularidad, generando una fuerte\n",
    "         respuesta emocional positiva en la audiencia. El contenido aquí\n",
    "         es tan impactante o entretenido que los usuarios no solo\n",
    "         reaccionan, sino que lo comparten masivamente y expresan asombro\n",
    "         y aprecio.\n"
